```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").javaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").javaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache: Map[String, Long] = Map()

    // Process onsite data
    val hitRate = onsiteData.map(new Function[String, (Boolean, Long)] {
      override def call(record: String): (Boolean, Long) = {
        val query = record.split(" ")(0)
        val timestamp = record.split(" ")(1).toLong

        if (broadcastTopQueries.value.contains(query)) {
          if (cache.contains(query) && timestamp - cache(query) <= 12 * 60 * 60) {
            (true, 1)
          } else {
            cache.put(query, timestamp)
            (false, 1)
          }
        } else {
          (true, 0)
        }
      }
    }).reduce((a, b) => (a._1 && b._1, a._2 + b._2))

    // Calculate hit rate
    val totalQueries = onsiteData.count()
    val hitQueries = hitRate._2
    val hitRateValue = hitQueries.toDouble / totalQueries.toDouble

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from text files. It then broadcasts the top frequent queries to all nodes in the cluster.

The job then initializes a cache to store the queries that have been retrieved and their timestamps. It processes each record in the onsite attributed data and checks if the query is present in the top frequent queries. If it is, the job checks if the query is already in the cache and if the current timestamp is within 12 hours of the cached timestamp. If it is, the job counts it as a cache hit and returns true. Otherwise, it retrieves the query, stores it in the cache, and returns false.

The job then calculates the hit rate by dividing the number of cache hits by the total number of queries in the onsite attributed data.

