import React from 'react';
import PropTypes from 'prop-types';

const Layout = ({ children, variant }) => {
  const layoutClass = variant === 'full-width' ? 'w-full' : 'w-1/2 mx-auto';

  return <div className={`${layoutClass} p-4`}>{children}</div>;
};

Layout.propTypes = {
  children: PropTypes.node.isRequired,
  variant: PropTypes.oneOf(['full-width', 'centered']),
};

Layout.defaultProps = {
  variant: 'centered',
};

export default Layout;
```

This component takes in a `children` prop, which is the content to be rendered within the layout, and a `variant` prop, which determines the layout's width and centering. The `propTypes` and `defaultProps` are used to ensure that the `variant` prop is one of the allowed values and to set a default value if none is provided.

The `layoutClass` variable is used to conditionally apply the appropriate Tailwind CSS classes based on the `variant` prop. If the `variant` is 'full-width', the `w-full` class is applied to set the width to 100%. If the `variant` is 'centered', the `w-1/2` and `mx-auto` classes are applied to set the width to 50% and center the layout horizontally.

The `p-4` class is applied to all variants to add some padding around the content.

Here is an example of how to use the `Layout` component:

```jsx
import Layout from './Layout';

const App = () => {
  return (
    <Layout variant="full-width">
      <h1>Welcome to my app!</h1>
      <p>This is some content.</p>
    </Layout>
  );
};

export default App;
```

