Creating a Chrome extension that takes screenshots of webpages involves several steps. Here's a basic outline of how you can create such an extension:

1. Create a new directory for your extension and create the following files:

- manifest.json
- popup.html
- popup.js
- background.js

2. In `manifest.json`, define the basic information about your extension:

```json
{
  "manifest_version": 2,
  "name": "Webpage Screenshot",
  "description": "This extension takes screenshots of webpages",
  "version": "1.0",
  "permissions": ["activeTab", "storage", "tabs", "<all_urls>"],
  "browser_action": {
    "default_icon": "icon.png",
    "default_popup": "popup.html"
  },
  "background": {
    "scripts": ["background.js"],
    "persistent": false
  }
}
```

3. In `popup.html`, create a simple UI for your extension:

```html
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Webpage Screenshot</title>
</head>
<body>
  <button id="capture">Capture Screenshot</button>
  <script src="popup.js"></script>
</body>
</html>
```

4. In `popup.js`, add the functionality to capture the screenshot when the button is clicked:

```javascript
document.getElementById('capture').addEventListener('click', function() {
  chrome.tabs.query({active: true, currentWindow: true}, function(tabs) {
    chrome.tabs.sendMessage(tabs[0].id, {action: 'capture'});
  });
});
```

5. In `background.js`, add the functionality to save the captured screenshot:

```javascript
chrome.runtime.onMessage.addListener(function(request, sender, sendResponse) {
  if (request.action === 'capture') {
    chrome.tabs.captureVisibleTab(null, {}, function(image) {
      var screenshotUrl = image;
      chrome.downloads.download({url: screenshotUrl, filename: 'screenshot.png'});
    });
  }
});
```

6. Load your extension into Chrome:

- Open Chrome and navigate to `chrome://extensions`.
- Enable "Developer mode" by clicking the toggle switch in the top right corner.
- Click the "Load unpacked" button and select the directory containing your extension files.

Now, when you click the extension's icon in the Chrome toolbar, a popup will appear with a "Capture Screenshot" button. Clicking this button will save a screenshot of the current webpage as a PNG file in your default downloads folder.

