To make the code run only once every 0.6 seconds, you can use a debouncing technique. Debouncing is a technique that ensures that a function is not called again until a certain amount of time has passed without it being called.

Here's how you can modify the code to use debouncing:

1. Create a debounce function that takes a function and a delay as arguments and returns a new function that will only call the original function once every delay milliseconds.
```javascript
const debounce = (func, delay) => {
  let debounceTimer;
  return function() {
    const context = this;
    const args = arguments;
    clearTimeout(debounceTimer);
    debounceTimer = setTimeout(() => func.apply(context, args), delay);
  }
}
```
2. Wrap the code inside the useEffect hook with the debounce function.
```javascript
const debouncedEffect = debounce(() => {
  tl.set($portfolioNext.current,{
    clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
  });
  tl.set($portfolioNext.current,{
    css:{backgroundImage:'url('+cursor.cursorImage+')'},
  });

