  });

  tl.set($portfolioCurrent.current,{
    css:{backgroundImage:'url('+cursor.cursorImage+')'},
  });
}, 600);
```
3. Call the debouncedEffect function inside the useEffect hook.
```javascript
useEffect(() => {
  debouncedEffect();
}, [cursor.cursorImage]);
```
Now the code inside the useEffect hook will only run once every 0.6 seconds, even if the cursor.cursorImage dependency changes more frequently than that.

